script: |
  super -f text -I q12064.spq | sort > q12064.out

inputs:
  - name: q12064.spq
    data: |
      SELECT - 30 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 43 <= ( - col1 + - 64 + - col0 * + 61 );
  - name: tab2

outputs:
  - name: q12064.out
    data: |
      -30
      -30
      -30
